webpackJsonp([0x5e27e9a3851e],{1267:function(e,t){e.exports={data:{site:{siteMetadata:{title:"Gatsby Starter - Forty by HTML5 UP",author:"Hunter Chang"}},markdownRemark:{id:"/Users/James/Repositories/portfolio-2018/src/posts/setting-up-asdoc-in-flex-builder/index.md absPath of file >>> MarkdownRemark",html:'<p>ASDoc is a command-line tool that you can use to create API language reference documentation as HTML pages from the classes in your Adobe<sup>®</sup> Flex<sup>®</sup> application. The Adobe Flex team uses the ASDoc tool to generate the Adobe Flex Language Reference. [From LiveDocs <a href="http://livedocs.adobe.com/flex/3/html/help.html?content=asdoc_1.html" target="_blank">http://livedocs.adobe.com/flex/3/html/help.html?content=asdoc_1.html</a>]</p>\n<p>Seb (a developer on the PPV3D team) shows you how to set this up in Flex Builder\n<a href="http://www.sebleedelisle.com/?p=401" target="_blank"> http://www.sebleedelisle.com/?p=401</a></p>\n<p>I could\'ve done with this earlier this week as I ended up using the Command Prompt instead!</p>\n<p>Also if you\'re @author is coming up with the wrong name Seb shows you how you can change the default:\n<a href="http://www.sebleedelisle.com/?p=404" target="_blank"> http://www.sebleedelisle.com/?p=404</a></p>\n<p>I think this could come in handy when working on large projects and/or projects with multiple developers.</p>',frontmatter:{title:"Setting up ASDoc in Flex Builder",date:"March 16, 2009",tags:["actionscript","flex","asdoc"]}}},pathContext:{}}}});
